import React from 'react';
import './App.css';
import Cell from "./Components/Cell/Cell"
import { Stage, Layer }  from 'react-konva';

let row1 = function row() {
  var result = ""
  for(let i = 0; i<10; i++)
  {
    result += `<Cell x={${50 + i*(35)}} y={50} />`;
  }
  console.log(result)
  return(result)
}
function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Stage width={window.innerWidth} height={window.innerHeight}>
      <Layer>
        {row1()}
      </Layer>
      </Stage>
      </header>
    </div>
  );
}

export default App;
